generated.css:
/* HTML5 display-role reset for older browsers */
article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
menu,
nav,
section {
    display: block;
}

html,
body,
div,
span,
applet,
object,
iframe,
h1,
h2,
h3,
h4,
h5,
h6,
p,
blockquote,
pre,
a,
abbr,
acronym,
address,
big,
cite,
code,
del,
dfn,
em,
img,
ins,
kbd,
q,
s,
samp,
small,
strike,
strong,
sub,
sup,
tt,
var,
b,
u,
i,
center,
dl,
dt,
dd,
ol,
ul,
li,
fieldset,
form,
label,
legend,
table,
caption,
tbody,
tfoot,
thead,
tr,
th,
td,
article,
aside,
canvas,
details,
embed,
figure,
figcaption,
footer,
header,
hgroup,
menu,
nav,
output,
ruby,
section,
summary,
time,
mark,
audio,
video {
    border: 0;
    font: inherit;
    font-size: 100%;
    margin: 0;
    padding: 0;
    vertical-align: baseline;
}

html {
    box-sizing: border-box;
    -webkit-text-size-adjust: 100%;
    -webkit-overflow-scrolling: touch;
}

*,
*:before,
*:after {
    box-sizing: inherit;
}

body {
    font-size: var(--base-font-size);
    line-height: 1.2;
    word-wrap: break-word;
}

h1,
h2,
h3,
h4,
h5,
h6,
p {
    margin: 0;
    padding: 0;
    line-height: 1.2;
}

a {
    text-decoration: none;
}

strong {
    font-weight: bold;
}

em {
    font-style: italic;
}

dl,
dd {
    margin: 0;
}

table {
    border-collapse: collapse;
    border-spacing: 0;
}

address {
    font-style: normal;
}

fieldset {
    padding: 0;
    margin: 0;
    border: 0;
}

img {
    display: block;
    max-width: 100%;
    height: auto;
    border: 0;
}
